import React, { useContext, useEffect, useState } from "react";
import axios from "axios";
import Button from "../button/singleButton";
import styles from "../card/CardList.module.scss";
import { storageToken } from "../../contexts/authContext";
import WalletCard from "./WalletCard";

interface Props {
   userWallet?: {};
}

function WalletCardList({ userWallet }: Props) {
   const [transactions, setTransactions] = useState<
      [
         {
            _id: number;
            type: string;
            pokemonId: number;
            baseExperience: number;
            transactionDate: Date;
            tradeValueAtOperationDate: number;
            BTCCurrencyAtTrade: number;
            status: string;
         }
      ]
   >();

   const token = storageToken();

   useEffect(() => {
      (async function () {
         await axios
            .get("http://localhost:3000/transactions", {
               headers: {
                  ["x-access-token"]: token,
               },
            })
            .then((res) => {
               setTransactions(res.data);
            });
      })();
   }, [userWallet]);
   console.log(transactions, "TRANSACTIONS");
   return (
      <div className={styles.container}>
         <ul className={styles.cardList}>
            {transactions
               ?.filter((transaction) => !transaction.status)
               ?.map((ownedPokemon) => {
                  return (
                     <WalletCard
                        baseExperience={ownedPokemon?.baseExperience}
                        pokemonId={ownedPokemon?.pokemonId}
                        transactionDate={ownedPokemon.transactionDate}
                        BTCCurrencyAtTrade={ownedPokemon?.BTCCurrencyAtTrade}
                        tradeValueAtOperationDate={
                           ownedPokemon?.tradeValueAtOperationDate
                        }
                     />
                  );
               })}
         </ul>
         <div className={styles.navigationPagesContainer}>
            <Button type="button">Página Anterior</Button>
            <Button type="button">Próxima Página</Button>
         </div>
      </div>
   );
}

export default WalletCardList;
